import React, {useState} from 'react';
import "./registration.css";
import Input from "../../utils/input/input";
import {registration} from "../../actions/user";
const Registration = () => {
    const [email,setEmail] = useState('')
    const [password,setPassword] = useState('')
    return (
        <div className={'registration'}>
            <div className="registration_header">Registration</div>
            <Input value={email} setValue={setEmail} type={"text"} placeholder={"input email..."}/>
            <Input value={password} setValue={setPassword} type={"password"} placeholder={"input password..."}/>

            <button className="registration_btn" onClick={()=> registration(email,password)  }>Sign up</button>
        </div>
    );
};

export default Registration;
